  const axios = require("axios");

  const options = {
    method: "GET",
    url: "https://google-authenticator.p.rapidapi.com/new_v2/",
    headers: {
      "X-RapidAPI-Key": "414bc5d180msh86e5db53aea8bbcp1bcd81jsn6915fb5401f0",
      "X-RapidAPI-Host": "google-authenticator.p.rapidapi.com",
    },
  };

  axios
    .request(options)
    .then(function (response) {
      console.log(response.data);
    })
    .then(function (data) {

    })
    .catch(function (error) {
      console.error(error);
    });


  return <h1>Scan the barcode from Google Authenticator</h1>;
}
